import { render, html } from 'lit-html';
import 'page-a/page-a.js'
import 'page-b/page-b.js'

export class PageC extends HTMLElement {
  constructor() {
    super();
    this.attachShadow({ mode: 'open' });
  }

  connectedCallback() {
    render(html`
      <p>I am page C</p>
      <page-a></page-a>
      <page-b></page-b>
    `, this.shadowRoot);
  }
}
